INSERT INTO `notes` VALUES (1,'test','2015-03-01 00:00:00'),(2,'Welcome to the 2015 Season! Captains, please allow the score page some time to load.','2015-05-04 18:43:44'),(3,'Welcome to the 2015 Season!\\nCaptains, please allow the score page some time to load.','2015-05-04 18:44:08'),(4,'Welcome to the 2015 Season!Captains, please allow the score page some time to load.','2015-05-04 18:44:19'),(5,'Welcome to the 2015 Season! Captains, please allow the score page some time to load.','2015-05-04 18:44:23'),(6,'Welcome to the 2015 Season!  Captains, please allow the score page some time to load.','2015-05-04 18:44:28'),(7,'Welcome to the 2015 Season! We are aware of some issues with the iPhone app, an update is coming.','2015-06-02 03:40:30'),(8,'Welcome to the 2015 Season! We are aware of some issues with the iPhone app and the QR codes; updates are coming!','2015-06-02 03:41:03'),(9,'League is cancelled for tonight (7/6/15).  Tonight will be rescheduled as a rainout for August 31st.','2015-07-06 20:53:30'),(10,'League is cancelled for tonight (7/6/15). Tonight will be rescheduled as a rainout for August 17th.','2015-07-06 20:58:05'),(11,'League is back on for 7/13. League was cancelled 7/6 and will be rescheduled as a rainout for 8/17.','2015-07-13 15:08:59'),(12,'Playoff and Rainout communication and support coming soon!','2015-07-28 20:29:25'),(13,'Playoff and Rainout communication and support coming soon! iPhone App is working great; Mobile-web looks pretty nice on Android.','2015-07-28 20:34:42'),(14,'Final Regular season match Tonight! Please have scores in by EOD tomorrow, 8/17 so that playoffs can be set quickly and correctly.','2015-08-17 19:03:25'),(15,'Regular Season is done and all results are in! Check back soon for finalized playoff matchups, although the ones shown should be correct.','2015-08-18 20:42:57'),(16,'Final Week! Schedule will be updated soon, but expect the matchups to be Earth v. Missing, Bush v. Eagles, Golf v. Mull, and Kraft v. Pins. Please remember that there is $$ for the first 3 matches, and the 4th match is open-format. Please decide with the other team if you\'ll be recording scores for handicap purposes or not; please do not decide after your round.','2015-08-25 16:15:17'),(17,'Final Week! Lexis Nexis match: Please decide with the other team if you\'ll be recording scores for handicap purposes or not; please do not decide after your round.','2015-08-31 15:39:04'),(18,'Congrats Missing Links on winning the League Championship (picture coming soon)! Next up is the league scramble on 9/26. More details to come soon!','2015-09-09 21:45:41'),(19,'Congrats Missing Links on winning the League Championship (picture coming soon)! Send any feature requests to Michael Harlow for the site/app for the 2016 Season.','2016-01-14 04:02:54'),(20,'Welcome to the 2016 Season! Please double-check all handicaps prior to Monday and email Michael Harlow with any questions. New players will be added shortly.','2016-04-27 14:38:01'),(21,'Due to a bug with the iOS app, please use the website as the source for tee times. Sorry for the inconvenience or any issues it may cause today!','2016-05-09 19:55:51'),(22,'Due to a bug with the iOS app, please use the website as the source for tee times. Sorry for the inconvenience or any issues it may cause today!','2016-05-09 19:55:50'),(23,'The schedule on the iOS app is now correct again; sorry for any inconvenience.','2016-05-24 17:07:32'),(24,'Course is very busy tonight; please allow extra time for parking!','2016-06-06 20:00:10'),(25,'Welcome to the 2016 season','2016-06-07 13:33:39'),(26,'The regular season is over and the standings are final. Final match information will be updated soon. The times will be reversed this year: 3:44-6/7 4:00-5/8 4:16-2/3 4:32-1/4.','2016-08-16 16:19:32'),(27,'Monday is the final round of the season! Matches will be up shortly, but expect: 3:44-Golf v Missing, 4:00-Earth v Mulligans, 4:16-Pinseekers v Bushwoods, 4:32-Angry v Kraft.','2016-08-26 14:02:49'),(28,'Change of course! Silver front this week!','2016-08-29 20:54:29'),(29,'Congratulations to the 2016 West Blue League Champions: Angry Birdies! During the off-season, any tech-feedback is much appreciated (send to Mike Harlow)!','2016-11-11 21:44:37'),(30,'Next week (5/1) begins the 2017 season; the tee times and matchups are coming very soon! Please note that this year handicaps will be based on best 4 of 6 and rounded down. There will also be 7 teams, so one team per week will play together and against their handicaps.','2017-04-27 14:06:29'),(31,'Welcome to the 2017 Season! Please note that this year handicaps will be based on best 4 of 6 and rounded down. There will also be 7 teams, so one team per week will play together and against their handicaps.','2017-05-01 05:52:43'),(32,'Week 1 is a RAINOUT! Makeup date is planned for 8/21. Please review everything on the site and send any issues to Michael Harlow.','2017-05-01 15:54:39'),(33,'Please review rookie information and Week 2 scores; email Michael Harlow with any issues. Captains: take a look at how \"bye week\" scoring went in it\'s first use with the Earthmovers.','2017-05-10 15:45:54'),(34,'League Week 3 Tonight! Despite the dark skies and iffy forecasts, we\'re still playing. Please pay attention to the site and emails from captains!','2017-05-15 18:33:56'),(35,'Enjoy the season and report any issues with the site to Mike Harlow!','2017-05-26 16:11:14'),(36,'Parking extremely limited! Front desk recommends parking past silver 4/5.','2017-06-05 20:19:34'),(37,'Parking extremely limited! Front desk recommends parking past silver 4/5.','2017-06-05 20:19:35'),(38,'Parking extremely limited! Front desk recommends parking past silver 4/5.','2017-06-05 20:20:02'),(39,'Week 6 is still on for tonight; stay tuned to email and course instruction! Please see rules & information below for information about weather delays and cancellations.','2017-06-12 19:34:07'),(40,'Update: league is cancelled (for 6/12)! Makeup will add to the end of the season.','2017-06-12 20:47:50'),(41,'Enjoy the season!','2017-07-18 13:11:37'),(42,'GOLD BACK TONIGHT! Please look for information regarding score entry; we may need to withhold scores until after the site update goes live.','2017-07-24 16:09:51'),(43,'Silver Front Tonight! Please look for information regarding score entry; we may need to withlhold scores until after the site update goes live.','2017-07-30 22:25:33'),(44,'Silver Front Tonight! Please look for information regarding score entry; we may need to withlhold scores until after the site update goes live.','2017-07-30 22:25:34'),(45,'Silver Front Tonight! Please look for information regarding score entry; we may need to withlhold scores until after the site update goes live.','2017-07-30 22:25:39'),(46,'Please look for information regarding score entry; we may need to withlhold scores until after the site update goes live.','2017-08-01 08:02:24'),(47,'Please look for information regarding score entry; we may need to withlhold scores until after the site update goes live.','2017-08-01 08:02:31'),(48,'Please review the site following updates for course-changes, rainouts, and playoffs and send any issues to Mike!','2017-08-03 04:27:50'),(49,'Despite weather, league is still currently ON for this afternoon; stay tuned for updates via email and this note!','2017-08-21 18:55:59'),(50,'Rain delay of 16 minutes; tee times starting at 4pm! Stay tuned for updates','2017-08-21 20:32:34'),(51,'Please stay tuned for final tee times; they will largely be last place teams first, first place teams last.','2017-08-31 13:33:26'),(52,'Scramble Leaderboard available here:  https://online.golfgamebook.com/leaderboard/2us-wl34. App join code is 86599597','2017-09-09 06:17:52'),(53,'Emerald Greens has pulled all the water jugs; please prepare accordingly. Vending machines are available on some holes.','2017-09-11 19:48:38'),(54,'Week 1 matches have concluded; week 2 matches will be posted ASAP once results are in. Bushwoods and Earthmovers experienced the first post-season tie in recent memory, resulting in a 1 hole playoff on Silver-10; Earthmovers took the hole 5-3 for a birth in the consolation match against Kraft Dinner.','2017-09-12 04:04:19'),(55,'Final week matchups are set! Please contact Mike with any issues you see. Good Luck!','2017-09-15 14:13:47'),(56,'League is still ON tonight! Good luck!','2017-09-18 20:23:55'),(57,'League is still ON tonight! Good luck!','2017-09-18 20:23:54'),(58,'League is still ON tonight! Good luck!','2017-09-18 20:24:01'),(59,'Great season, everyone! See you next season, and please ask other TR golfers if they are interested in joining.','2017-11-06 22:23:19'),(60,'Monday 4/30 is the start of the season! Thank you for your patience as the schedule, advertised handicaps, and other updates come online.','2018-04-28 07:11:33'),(61,'Monday 4/30 is the start of the season! Thank you for your patience as we have rolled out all the info. Please report any misspellings or flaws!','2018-04-30 06:33:49'),(62,'Final week of league was rained out and will be played on 9/10 on Silver Back. Stay tuned for the site to be updated to reflect this change.','2018-08-28 22:13:45'),(63,'Congratulations, Kraft Dinner on winning the 2018 season! Only 7 months until next season...','2018-09-13 15:24:42'),(64,'Get ready for the 2019 season, coming soon! Please work with your captain to get your team solidified, including any new members or roster changes.','2019-04-07 19:01:13'),(65,'Enjoy the 2019 season! Please report any issues you have with the website.','2019-05-22 00:17:02'),(66,'Another rainout - 9/9 will now be the regular season finale, with 9/16 being the new playoff week. It will be played on Gold Front with 1-4, 2-3 pairings. Good luck getting a win and snagging the 2nd championship spot!','2019-08-27 13:17:41'),(67,'ok enough rain already!!  9/16 will now be the regular season finale, with 9/23 being the new playoff week.  9/16 will be played on Gold Front with 1-3, 2-4 pairings.  9/23 will be played on Gold Back with 1-4, 2-3 pairings.  Good luck getting a win and snagging the 2nd championship spot!','2019-09-11 22:48:19'),(68,'Congratulations to Kraft Dinner for winning the second half of the golf league.  Kraft Dinner will defend its championship against Earthmovers next Monday (Sep 23rd).  The rest of the playoff seedings are also now set on the website. Best of luck to each team as we look to wrap up another successful year of golf for the West Blue Golf League.','2019-09-17 20:55:41'),(69,'Congratulations to the Earthmovers for winning the 2019 West Blue Golf League Championship!  To all golfers: thank you for another great golfing season and enjoy golfing on your own time for the rest of 2019.  Hope to see you all back in 2020!','2019-09-24 20:31:34'),(70,'2020 League starts Monday! Tee Times will be sent out soon and the site will also be updated. Once done, please check handicaps and report any issues.','2020-04-26 17:08:35'),(71,'Congratulations It\'s in the Hole on winning the 2020 crown! Scramble this Saturday - stay tuned for live-scoring information.','2020-09-07 15:16:21'),(72,'Another season is right around the corner, starting 4/26. The site is still being updated but should be accurate soon! Please confirm your handicaps, especially if you are new to the league, returning or on a new team this year by searching players.','2021-04-12 17:57:41');
